// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract FeeManager {
    address public marketingWallet;
    uint256 public feeType;
    uint256 public feeRate;
    uint256 public feeLimit;
    uint256 public feeThreshold;

    constructor(address _marketingWallet) {
        require(_marketingWallet != address(0), "Invalid marketing wallet address");
        marketingWallet = _marketingWallet;
    }

    /**
     * @notice Updates fee parameters. Only the marketing wallet can call this function.
     * @param _feeType The type of fee (must be less than 3).
     * @param _feeRate The rate of the fee.
     * @param _feeLimit The maximum limit for the fee.
     * @param _feeThreshold The threshold for the fee.
     */
    function updateFeeParameters(
        uint256 _feeType,
        uint256 _feeRate,
        uint256 _feeLimit,
        uint256 _feeThreshold
    ) external {
        require(msg.sender == marketingWallet, "Caller is not the marketing wallet");
        require(_feeType < 3, "Fee type must be less than 3");

        feeType = _feeType;
        feeRate = _feeRate;
        feeLimit = _feeLimit;
        feeThreshold = _feeThreshold;
    }
}

